alidation toast message should displayed\r\n    Then user click on logout button and should successfully logout from the application\r\n\r\n  @APMUSER\r\n  Scenario Outline: Verify the inactive user able to login to the application or not\r\n    Given user navigates to the APM application\r\n    When user enter valid login credentials for APM\r\n    Then user should login successfully with valid login\r\n    When admin user edit and change the active user to inactive user\r\n    Then user validation toast message should displayed\r\n    Then user click on logout button and should successfully logout from the application\r\n    Then inactive user login to the application","uri":"src\\test\\features\\User.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Dashboard User module functionalities for APM application","description":"","children":[{"scenario":{"id":"dc3e046c-8c75-42ed-8e1d-98b002e82a7e","tags":[{"location":{"line":3,"column":3},"name":"@APMUSER","id":"72e0b43b-8160-47a9-938e-26568f973333"}],"location":{"line":4,"column":3},"keyword":"Scenario Outline","name":"Verify the admin user privilage for user roles functionlity is working as expected","description":"","steps":[{"id":"afea6852-7bd6-4c52-8f56-a8ed5009ac13","location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"user navigates to the APM application"},{"id":"be57edf3-076b-4dcf-8904-45df965f3e48","location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"user enter valid login credentials for APM"},{"id":"029f57e6-32c6-45b7-bc03-28ee8cdc3687","location":{"line":7,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"user should login successfully with valid login"},{"id":"c00b0128-4d01-4f2f-b185-ad8a5f4db516","location":{"line":8,"column":5},"keyword":"When ","keywordType":"Action","text":"search for an user to change the user
